import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';
import './propertylisting.css'

const PropertyListing = () => {

    const { id } = useParams();
    const [property, setProperty] = useState(null);
  
    useEffect(() => {
      fetch(`http://localhost:3001/api/properties/${id}`)
        .then(response => response.json())
        .then(data => {
          setProperty(data);
        })
        .catch(error => console.log(error));
    }, [id]);
  
    if (!property) return <div>Loading...</div>;

    const center = {
        lat: property.location.lat,
        lng: property.location.lng
      };


  return (
    <div className="max-w-screen-xl mx-auto" style={{ width: '1605px' }}>
      {/* Main container */}
      <div className="bg-white">
        {/* Property Content Section */}
        <div className="grid grid-cols-3 gap-6 p-5">
          {/* Main Info */}
          <div className="col-span-2">
            <img src="https://placehold.co/900x500" alt="Property" className="mb-4" />
            <h1 className="text-2xl font-bold mb-2">SAR {property.price}</h1>
            <div className="font-medium mb-2">{property.beds} Beds &bull; {property.wc} Baths &bull; {property.area} sqm</div>
            <ul className="list-disc list-inside mb-4">
              <li>Sophisticated {property.beds} Bedroom for Purchase in {property.city}, {property.district}</li>
              <li>{property.area} sq.m.</li>
              <li>Chiller Free</li>
              <li>Spacious Living and Dining Area</li>
            </ul>
            <button className="text-blue-600">Read More</button>
          </div>

          {/* Sidebar */}
          <div>
            <div className="mb-4">
              <img src="https://placehold.co/300x300" alt="Agent" className="mb-2" />
              <div className="text-lg font-medium">Fares Ali</div>
              <button className="bg-blue-600 text-white rounded px-4 py-2 mb-2">Call</button>
              <button className="bg-blue-600 text-white rounded px-4 py-2">Email</button>
            </div>
            <div className="p-4 bg-gray-100">
              <div className="font-medium mb-2">Prospecter Real Estate</div>
            </div>
          </div>
        </div>

        {/* Additional Details */}
        <div className="px-5 py-4 grid grid-cols-2 gap-6">
          <div>
            <h3 className="font-semibold mb-3">Property Information</h3>
            <table className="text-sm">
              <tr><td className="pr-4 py-1">Type</td><td>Apartment</td></tr>
              <tr><td className="pr-4 py-1">Purpose</td><td>For Rent</td></tr>
              <tr><td className="pr-4 py-1">Added on</td><td>29 February 2024</td></tr>
              <tr><td className="pr-4 py-1">Reference no.</td><td>Bayut-313-Ap-R-2935</td></tr>
            </table>
          </div>

                  {/* Google Map Section */}
        <LoadScript
          googleMapsApiKey="AIzaSyDyfWB6bmr8PsGb_UVjLQvzbgMD-7crbfs" // Replace with your API key
        >
          <GoogleMap
            mapContainerStyle={containerStyle}
            center={center}
            zoom={15}
          >
            { /* Child components, such as markers, info windows, etc. */}
            <Marker position={center} />
          </GoogleMap>
        </LoadScript>
        </div>
      </div>
    </div>
  );
};

export default PropertyListing;
